from typing import Anyfrom src.base.query import QueryModuleclass JDQuery(QueryModule):    """    知识查询模块儿    """    def process_query_results(self, query_content: str, query_results: list) -> Any:        """        对知识查询模块儿执行查询的结果进行二次处理并返回给对话应用        Args:            query_content: 查询内容            query_results: 查询结果        Returns: 处理后的查询结果        """        knowledge = [v['content'] for v in query_results]        return knowledge